import React, {Component} from 'react';
// import logo from './logo.svg';

import {Image} from 'react-bootstrap';


class MonkeyCard extends Component {

    render() {
    return (
      <div>
        <Image style={{ width: '4rem' }} src="/assets/speak-no-evil-monkey.png" roundedCircle thumbnail />
          <div>First and last name</div>
          <div>Title/role/company</div>
      </div>
    );
  } 
}


export default MonkeyCard;
